# @param {String} s
# @param {String[]} words
# @return {Integer[]}
def find_substring(s, words)
    w_len = words.first.length
    min_len = words.size*words.first.length
    word_tally = words.tally

    return [] unless s.size >= min_len
    if words.uniq.size == 1 && s.chars.uniq.size ==1
        return (0..(s.size-min_len)).to_a
    end
    result = []

    i = 0 
    while (i+min_len) <= s.size 
        s_str = s[i...(min_len+i)]
        if is_valid?(word_tally.dup, s_str, w_len)
            result << i 
        end
        i +=1 
    end

    result

end

def is_valid?(tword_tally, s_str, w_len)
        k = 0 
        while  k < s_str.size 
            s_word = s_str[k...(k+w_len)]
            
            if tword_tally[s_word].to_i == 0 
               return false
            else
                tword_tally[s_word] -= 1
            end

            k += w_len
        end

        return true
end

